import React from 'react';
import {  withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid'

const styles = theme => ({
    button: {
        color: 'primary'
    },
    svg: {
        color: 'primary'
    },
    container: {
        justify: 'space-between',
    }
});

const menuTabs = [
    'Über Mich',
    'Leistungen',
    'Klaviere an besonderen Orten',
    'Kontakt'
]

const StyledButton = styled(Button)`
  &:hover {
    background: none;
  }
`

class CustomButton extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            mouseover: false,
            color: '#424242'
        }
    }

    render() {
        const classes = this.props;
        return (
            <div>
                <Grid className={classes.container}>
                    <Button>
                        <svg
                            width="24px"
                            height="24px"
                            viewBox="0 0 24 24">
                            <path
                                fill='#424242'
                                cassName={classes.svg}
                                d="M12 5.69L17 10.19V18H15V12H9V18H7V10.19L12 5.69M12 3L2 12H5V20H11V14H13V20H19V12H22L12 3Z"
                            />
                        </svg>
                    </Button>
                    <Button color="inherit">Über Mich</Button>
                    <Button color="inherit">Leistungen</Button>
                    <Button color="inherit">Klaviere an Besonderen Orten</Button>
                    <Button color="inherit">Referenzen</Button>
                    <Button color="inherit">Kontakt</Button>
                </Grid>

            </div>

        );
    }
}

export default withStyles(styles)(CustomButton);
